import "./Dashboard.css";
import React, { useState, useEffect } from "react";
import { useHistory } from 'react-router-dom';
import { Container, Row, Col, Image, Card, Button } from "react-bootstrap";
// import "bootstrap/dist/css/bootstrap.min.css";
import FriendCard from "../friendCards/FriendCard";
import SendFriendRequest from "../sendFriendRequest/SendFriendRequest";
import IncomingFriendRequests from "../incomingFriendRequests/IncomingFriendRequests";
import { withCookies, Cookies } from 'react-cookie';
import { instanceOf } from 'prop-types';
import axios from "axios";

function Dashboard(cookies) {
  const history = useHistory();
  const [headerText, setHeaderText] = useState("Hello!");
  const [userProfile, setUserProfile] = useState(null);
  const token = cookies.cookies.get("spotifyToken");

  const setValue = () => {
    let userInput = document.getElementById("status").value;
    setHeaderText("Hello " + userInput + "!");
  };

  useEffect(() => {
    (async () => {    
      const user = await axios.get("https://api.spotify.com/v1/me", {
        headers: {
          "Authorization" : `Bearer ${token}`
        }
      });
      
      if (user.status === 200) {
        setUserProfile(user.data);
      } else {
        console.log("Error retrieving user profile");
      }
    })();
  }, []);

  const logOut = () => {
    cookies.cookies.remove('spotifyToken');
    history.push("/");
  }

  return (
    <Container fluid>
      <Row>
        <Col className="col-3">
          <Container className="profile-pic">
            <Image
              fluid 
              src = {userProfile === null ? "" : userProfile.images[0].url}
              roundedCircle
            />
          </Container>

          <Container className="recent-activity">
            <Container className="recent-text">Recent Activity</Container>
            <Card className="recent-song-card">
              <Card.Img
                variant="top"
                src="data:image/jpeg;base64,"
                rounded="true"
              />
              <Container className="recent-info">
                <span className="user-recent-title">title</span>
                <span className="user-recent-artist">artist</span>
              </Container>
            </Card>
          </Container>
          <Container className="log-out-container" >
            <button className="log-out-button" onClick={logOut} >
            Log out
            </button>
          </Container>
        </Col>
        <Col className="col-9">
          <div className="welcome">
            <h1 id="hello-name">{userProfile === null ? "Hello!" : `Hello ${userProfile.display_name}!`}</h1>
          </div>
          <div className="user-id-container">
            <span className="user-id-span">{userProfile === null ? '' : `Your user ID is ${userProfile.id}`}</span>
          </div>
          {/* <div className="welcome-container">
            <input
              name="status"
              placeholder="How are you feeling right now?"
              type="text"
              maxLength="512"
              id="status"
              className="statusInput"
            />
            <Button onClick = {setValue} className="check-in-btn">Check In!</Button>{' '}
          </div> */}
          <SendFriendRequest user={userProfile ? userProfile.id : null} />
          <IncomingFriendRequests user={userProfile ? userProfile.id : null} />          
          <Container className="friends">
          <Container className="friends-recent">
              <h3>Your Friends' Recent Activity </h3>
            </Container>
            <Container className="inner-friend-container">
              <FriendCard
                name="Friend1"
                profilePicture = "data:image/jpeg;base64,"
                song="Call Me Maybe"
                artist="Carly Rae Jepsen"
                albumcover="data:image/jpeg;base64,"
              ></FriendCard>
              <FriendCard></FriendCard>
              <FriendCard></FriendCard>
              <FriendCard></FriendCard>
              <FriendCard></FriendCard>
              <FriendCard></FriendCard>
            </Container>
          </Container>
        </Col>
      </Row>
    </Container>
  );
}

Dashboard.propTypes = {
  cookies: instanceOf(Cookies).isRequired,
};

export default withCookies(Dashboard);